import React, { Component } from 'react';
import '../App.css';

class AlbumOverlay extends Component{
  render(){
    return(
      <div style={{width: '100%', height: '100%'}}>
        <div style={{position: 'relative',zIndex: '500', height: '50px', width: '50px', color: 'white'}}>X</div>
        <div style={{color: 'white'}}>asad</div>
      </div>
    )
  }
}

export default AlbumOverlay
